My Daughter's Boyfriend #11 (NEW 2014 Sweet Sinner) (Split Scenes)

Ava Addams, Sara Luvv, Karla Kush, Logan Pierce, Steven St.Croix

Kelsey's confused. Her daughter Sara and her best friend's son Seth have grown up together just like brother and sister in the same house. There's a naughty rumor they're more than siblings. Kelsey confides in her hubby who in turn does more than talk to their daughter's girlfriend. At least Mom isn't going to sleep with Seth. Or is she?? Starring voluptuous Ava Addams as the mom, sweet but not innocent Sara Luvv as her daughter and cute and sexy Karla Kush as Sara's girlfriend, with Logan Pierce, Steven St. Croix and a cameo with the legendary Kylie Ireland.

